import React, {useContext, useEffect} from 'react';
import {
    Button,
    Cascader, ConfigProvider,
    DatePicker,
    Form,
    Input,
    InputNumber,
    Mentions,
    Select,
    TreeSelect, Upload,
} from 'antd';
import {Text} from "@react-pdf/renderer";
import Title from "antd/es/typography/Title";
import {useParams} from "react-router-dom";
import {observer} from "mobx-react-lite";
import TextArea from "antd/es/input/TextArea";
import {UploadOutlined} from "@ant-design/icons";
import ruRU from "antd/es/locale/ru_RU";
import {Context} from "../../index";
import {fetchEvent, fetchTypes} from "../../http/eventAPI";
const { RangePicker } = DatePicker;
const formItemLayout = {
    labelCol: {
        xs: {
            span: 24,
        },
        sm: {
            span: 6,
        },
    },
    wrapperCol: {
        xs: {
            span: 24,
        },
        sm: {
            span: 14,
        },
    },
};
const CreateEvent = () =>{
    const {id} = useParams();
    const {event} = useContext(Context)

    const titleText = id == undefined ? "Создание мероприятия" : "Редактирование мероприятия";


    useEffect(() => {
        fetchTypes().then(data => event.setTypes(data))
       console.log(event.types)
    }, []);


    const normFile = (e) => {
        console.log('Upload event:', e);
        if (Array.isArray(e)) {
            return e;
        }
        return e?.fileList;
    };


return(
    <div style={{margin: '2%'}}>
        <Title level={2}>
            {titleText}
        </Title>
    <Form
        {...formItemLayout}
        variant="filled"
        style={{
            maxWidth: 600,
        }}
    >
        <Form.Item
            label="Название"
            name="Name"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Input />
        </Form.Item>

        <Form.Item
            label="Описание"
            name="Discription"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <TextArea
                autoSize={{
                    minRows: 2,
                    maxRows: 6,
                }}
            />
            <div

            />
        </Form.Item>

        <Form.Item
            label="Дата и время"
            name="DateTime"
            rules={[
                {
                    required: true,
                    message: '123',
                },
            ]}
        >
            <ConfigProvider locale={ruRU}>
                 <DatePicker showTime format="YYYY-MM-DD HH:mm" />
            </ConfigProvider>
        </Form.Item>

        <Form.Item
            valuePropName="fileList"
            getValueFromEvent={normFile}
            label="Изображение"
            name="Image"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Upload name="logo" action="/upload.do" listType="picture">
                <Button icon={<UploadOutlined />}>Загрузить</Button>
            </Upload>
        </Form.Item>

        <Form.Item
            label="Тип меропрития"
            name="Type"
            options={event.types}
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Select options={event.types}/>
        </Form.Item>

        <Form.Item
            label="Cascader"
            name="Cascader"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Cascader />
        </Form.Item>

        <Form.Item
            label="TreeSelect"
            name="TreeSelect"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <TreeSelect />
        </Form.Item>

        <Form.Item
            label="DatePicker"
            name="DatePicker"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <DatePicker />
        </Form.Item>

        <Form.Item
            label="RangePicker"
            name="RangePicker"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <RangePicker />
        </Form.Item>

        <Form.Item
            wrapperCol={{
                offset: 6,
                span: 16,
            }}
        >
            <Button type="primary" htmlType="submit">
                Submit
            </Button>
        </Form.Item>
    </Form>
    </div>
);
}
export default observer(CreateEvent);
